import React from 'react';
import { Map, Marker } from 'google-map-react';

const Location = () => {
  return (
    <div>
      <Map
        center={[37.7749, -122.4194]}
        zoom={13}
      >
        <Marker
          position={[37.7749, -122.4194]}
          title="San Francisco"
        />
      </Map>
    </div>
  )
}

export default Location
